import React from 'react';
import './Sidebar.css';

const Sidebar = () => {
  return (
    <div className="sidebar">
      <div className="sidebar-header">
        <h2>Administrador</h2>
      </div>
      <ul className="menu">
        <li>Inicio</li>
        <li>Mensajes</li>
        <li>Lista de tareas</li>
        <li>Usuarios</li>
        <li>Configuración</li>
        <li>Activos</li>
        <li>Proveedores</li>
        <li>Salida de Activos</li>
        <li>Cerrar sesión</li>
      </ul>
    </div>
  );
};

export default Sidebar;
